import TodoIndex from '/Users/lauren/Flatiron/note-taker-fe/src/components/TodoIndex.js'

const BASE_URL = 'http://localhost:3000'
const TODOS_URL = `${BASE_URL}/todos`

export default class MainContainer extends Component {

    componentDidMount(){
        fetch(TODOS_URL)
        .then(res => res.json())
        .then(todos => {this.getTodos(todos)})
    }

    getTodos = (todos) => {
        return todos
    }

    render() {
        return (
            <div>
                <TodoIndex todos={this.getTodos}/>
            </div>
        )

    }
}
